import React from 'react';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';

const Home = () => {
    return (
        <Box>
            <Typography variant="h5" gutterBottom>
                This will eventually take you to the Home (logged in) page
            </Typography >
            <Button variant="contained" href="/">
                Go back to home page :)
            </Button>
            <Typography variant="h3" gutterBottom>
                Dining
            </Typography>
            <Typography variant="h5" gutterBottom>
                Open Now
            </Typography>
            <Typography variant="h5" gutterBottom>
                Open Later
            </Typography>

            <Typography variant="h5" gutterBottom>
                Closed
            </Typography>

            <Typography variant="h3" gutterBottom>
                Gym
            </Typography>
            <Typography variant="h5" gutterBottom>
                Bruin Buddies
            </Typography>
            <Typography variant="h5" gutterBottom>Open Now & Activity Level</Typography>

        </Box>

    );
};

export default Home;
